import { createRouter, createWebHistory } from 'vue-router'
import DashboardView from '@/views/DashboardView.vue'
import Employee_DirectoryView from '@/views/Employee_DirectoryView.vue'
import Payroll__BenefitsView from '@/views/Payroll_&_BenefitsView.vue'
import Time_OffView from '@/views/Time_OffView.vue'
import AttendanceView from '@/views/AttendanceView.vue'
import LoginView from '@/views/LoginView.vue'

const routes = [
  {
    path: '/',
    redirect: '/login'
  },
  {
    path: '/login',
    name: 'Login',
    component: LoginView
  },
  {
    path: '/',
    name: 'Login',
    component: LoginView
  },
  {
    path: '/employee directory',
    name: 'Employee Directory',
    component: Employee_DirectoryView
  },
  {
    path: '/payroll & benefits',
    name: 'Payroll & Benefits',
    component: Payroll__BenefitsView
  },
  {
    path: '/time off',
    name: 'Time Off',
    component: Time_OffView
  },
  {
    path: '/attendance',
    name: 'Attendance',
    component: AttendanceView
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
